import logo from "./logo.svg";
import "./App.css";
import DataTableScene from "./scene/DataTableScene";
import Container from "@material-ui/core/Container";
import { AppBar } from "@material-ui/core";
function App() {
  return (
    <div className="App">
      <AppBar />
      <Container maxWidth="xl">
        <DataTableScene />
      </Container>
    </div>
  );
}

export default App;
